<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>Cuveen</title>
    <style>
        html, body {
            background-color: #fff;
            color: #636b6f;
            font-family: 'Nunito', sans-serif;
            font-weight: 200;
            height: 100vh;
            margin: 0;
        }
        .full-height {
            height: 100vh;
        }

        .flex-center {
            align-items: center;
            display: flex;
            justify-content: center;
        }
        .content {
            text-align: center;
        }
        .links{
            margin-top: 10px;
            border-top: 1px solid #ccc;
            padding-top: 10px;
        }
        .links > a {
            color: #636b6f;
            padding: 0 25px;
            font-size: 13px;
            font-weight: 600;
            letter-spacing: .1rem;
            text-decoration: none;
            text-transform: uppercase;
        }
    </style>
</head>
<body>
<div class="flex-center full-height">
    <div class="content">
        <div class="title">
            <img src=" data:image/png;base64,">
        </div>

        <div class="links">
            <a target="_blank" href="https://cuveen.com/docs">Docs</a>
            <a target="_blank" href="https://blog.cuveen.com">Blog</a>
            <a target="_blank" href="https://github.com/cuveen/cuveen">GitHub</a>
        </div>
    </div>
</div>
</body>
</html>